import logo from "../../img/SillyCoder.png";
import "../../css/App.css";
import { motion } from "framer-motion";

function SillyGoose() {
  const dash = () => {
    window.location = "../dashboard";
  };

  const git = () => {
    Object.assign(document.createElement("a"), {
      target: "_blank",
      rel: "noopener noreferrer",
      href: "https://github.com/SillyCodeDev",
    }).click();
  };

  const oos = () => {
    if (
      window.confirm(
        "Leave this site to https://adorable-dango-7cc7d0.netlify.app/ ?"
      )
    ) {
      window.location.replace("https://adorable-dango-7cc7d0.netlify.app/");
    }
  };

  const sw = () => {
    window.location = "/devteam/sillygoose/switched";
  };

  const mem = () => {
    window.location = "/devteam";
  };

  return (
    <>
      <nav id="north">
        <div className="navbar">
          <div className="logoNav">
            <motion.a
              href="index"
              whileHover={{ scale: 1.1 }}
              whileTap={{ scale: 0.9 }}
              className="logoBtn"
            >
              <img
                className="logo"
                alt=""
                src={logo}
                width="150px"
                height="150px"
              ></img>
            </motion.a>

            <motion.button
              whileHover={{ scale: 1.1 }}
              whileTap={{ scale: 0.9 }}
              className="DashboardBtn"
              onClick={dash}
            >
              Dashboard
            </motion.button>
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.9 }}
              className="aboutusbtn"
              onClick={mem}
            >
              About Us
            </motion.button>
          </div>
        </div>
      </nav>
      
      
    </>
  );
}

export default SillyGoose;
